import React, {useState} from "react";
import {Button, Modal} from "react-bootstrap";
import ButtonCreate from "../ButtonCreate";
// import Modal from "../Modal";

import './MainPage.scss';



const MainPage = (props) => {
	const [state, setState] = useState(false)

	const handleClose = () => setState(false);
	const handleShow = () => setState(true);

	return (
		<div className="wrap">
			<div className="wrap__top">
				<div className="title">
					<div className="title__text">Sales statistics</div>
					<div className="title__desc">Welcome to CRM dashboard</div>
				</div>
				<ButtonCreate onClick={handleShow} />
				{/*<Modal />*/}
				<Modal show={state} onHide={handleClose}>
					<Modal.Header closeButton>
						<Modal.Title>Modal heading</Modal.Title>
					</Modal.Header>
					<Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
					<Modal.Footer>
						<Button variant="secondary" onClick={handleClose}>
							Close
						</Button>
						<Button variant="primary" onClick={handleClose}>
							Save Changes
						</Button>
					</Modal.Footer>
				</Modal>
			</div>
			<hr/>
			<div className="wrap__content">
				<div className="graphs">
					<div className="graph-1 graph">

					</div>
					<div className="graph-2 graph">

					</div>
					<div className="graph-3 graph">

					</div>
				</div>
			</div>
		</div>
	)
}

export default MainPage;
